    const myStyle={
        backgroundImage:`url("http://localhost:3000/Imgs/bg.png")`,
                height:'100%',
                //marginTop:'-70px',
                backgroundAttachment: 'fixed',
                backgroundSize: 'cover',
                backgroundRepeat: 'no-repeat',
                };
    return ( 
        <>
        <div  className="bg" style={myStyle}>





            <NavBar></NavBar>
            <Banner></Banner>
            <MiddleLayer></MiddleLayer>
            <Footer></Footer>
            </div>
        </>
     );
}

export default MainPage;
